import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectPage: true,
    };
  }
  render() {
    console.log(this.state.selectPage);
    return (
      <div>
        <div>{this.state.selectPage && <Users />}</div>
        <div>{this.state.selectPage === false && <Play />}</div>
      </div>
    );
  }
  pageSel = () => {
    this.setState({ selectPage: this.props.sel });
  };
}

export default App;
